import React, {Component} from 'react';
import './About.css';

class About extends Component {

	render() {
		return (
			<div id={'about'} className={'about'}>
				<h1 className={'heading'}>About</h1>
				<div className={'content'}>
					<div className={'left-content content-box'}>
						<div className={'education'}>
							<p>COLLEGE OF APPLIED TECHNOLOGY SCIENCE</p>
							<p>Course : Information Technologies</p>
							<p>Degree : bachelor</p>
						</div>
					</div>
					<div className={'right-content content-box'}>
						<div className={'education'}>
							<p>COLLEGE OF APPLIED TECHNOLOGY SCIENCE</p>
							<p>Course : Information Technologies</p>
							<p>Degree : bachelor</p>
						</div>
					</div>
				</div>
			</div>
		);
	}
}

export default About;
